import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Form } from "react-bootstrap";
import "./styles.css";
import pointGreen from "../../assets/icons/pointGreen.svg";

const OrderRest = () => {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col>
          <Form
            inline
            style={{
              padding: "25px 0",
              display: "flex",
              justifyContent: "space-around",
            }}
          >
            <Form.Control
              as="select"
              className="my-1 mr-sm-2"
              id="inlineFormCustomSelectPref"
              custom
            >
              <option value="all">Todos</option>
              <option value="received">Recibidos</option>
              <option value="inMaking">En preparaci√≥n</option>
              <option value="finishes">Terminados</option>
              <option value="sent">Enviados</option>
            </Form.Control>
            <Form.Control
              as="select"
              className="my-1 mr-sm-2"
              id="inlineFormCustomSelectPref"
              custom
            >
              <option value="all">Recientes</option>
              <option value="received">Antiguos</option>
            </Form.Control>
          </Form>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              alignItems: "baseline",
            }}
          >
            <div>
              <h4>Combo 1</h4>
              <p>3 min</p>
              <span>Recibido</span>
            </div>
            <img src={pointGreen}></img>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default OrderRest;
